import React, { Component } from "react";
import photo1 from './images/BrookeAndJason/BeachPolaroid.jpg';
import photo2 from './images/BrookeAndJason/DiveMotelHalloween.jpg';
import photo3 from './images/BrookeAndJason/Halloween2015.jpg';
import photo4 from './images/BrookeAndJason/Halloween2016.jpg';



class Photos extends Component{





    render(){
        function importAll(r) {
            let images = {};
            r.keys().map((item, index) => { images[item.replace('./', '')] = r(item); });
            return images;
          }
        const images = importAll(require.context('./images/BrookeAndJason', false, /\.(png|jpe?g|svg)$/));
        console.log(images);
        return (
            <>
               <div class="item">
                   <div class="polaroid"><img src = {images[0]}></img>
                    <div class="caption">Love ballons</div>
                </div>
                </div>


            </>
        );
    }

}

export default Photos;
